import React from 'react';
import styled from 'styled-components';

export function ContainerStyled({
    children
}) {
    return <div className="container"
    style={{ 
        paddingTop: 20, 
        top: '20%', 
        left: '40%', 
        position: 'absolute', 
        paddingBottom: 20,
        backgroundColor: 'white'}}>{children}</div>
}
